from typing import List

class Solution:
    def maximizeSweetness(self, sweetness: List[int], k: int) -> int:
        # So the core idea is that is that we may not get a partition
        # where the min sweetness is exactly x. Don't worry about it.
        # If it works for x, then it definitely works for x-1.
        # If it does not work for x, then it definitely does not work for x+1.
        # Check the for loop that shows the cutoff point for each test case.
        def cut_possible(n):
            res = 0
            curr = 0
            for s in sweetness:
                curr += s
                if curr >= n:
                    res += 1
                    curr = 0
            return res >= k + 1
        #for i in range(1, 11):
        #    is_possible = cut_possible(i)
        #    print(i, is_possible)
        #left, right = 1, 10**20  # This works and takes more ms, a better limit is below
        left, right = 1, sum(sweetness) // (k + 1)
        while left < right:
            mid = (left + right + 1) // 2
            is_possible = cut_possible(mid)
            #print(left, right, mid, is_possible)
            if is_possible:
                left = mid
            else:
                right = mid - 1
        return left

